  `status` smallint(6) DEFAULT 1 COMMENT '1 : 正常 -1：删除 0: 暂停',
  `create_user` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
  `create_time` datetime(0) DEFAULT NULL,
  `update_user` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
  `update_time` timestamp(0) NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP(0),
  PRIMARY KEY (`pk_id`) USING BTREE,
  INDEX `idx_conf_info_group`(`pk_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 78 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '存储任务分组配置' ROW_FORMAT = Dynamic;

